import React from 'react';

const Footer = () => {
  return (
    <div className="footer">
      <div className="left-part">
        <img src="./logo.png" alt="image du logo" />
        <ul>
          <a href=""></a>
        </ul>
      </div>
    </div>
  );
};

export default Footer;
